import MainClick from "./MainScooter";

function Boss(handleClick, bossCount, HP, defense, number) {
    return ( 
        <div className="main_click">
            <MainClick handleClick = {handleClick} number = {number} bossCount = {bossCount} />
            <span className="main_count red" id="count">HP: {HP.toFixed(0)} Защита: {defense.toFixed(0)}</span>
      </div>
     );
}

export default Boss;
